function StCompareButtonAction() {
  $(".st-compare-button").click(function () {
    if (!$(".st-compare-button.active").length) {
      var total_product_compare = compared_products.length;
      var id_product = $(this).data("id-product");
      var content_product_compare_mess_remove =
        productcompare_remove +
        '. <a href="' +
        productcompare_url +
        '" target="_blank"><strong>' +
        productcompare_viewlistcompare +
        ".</strong></a>";
      var content_product_compare_mess_add =
        productcompare_add +
        '. <a href="' +
        productcompare_url +
        '" target="_blank"><strong>' +
        productcompare_viewlistcompare +
        ".</strong></a>";
      var content_product_compare_mess_max =
        productcompare_max_item +
        '. <a href="' +
        productcompare_url +
        '" target="_blank"><strong>' +
        productcompare_viewlistcompare +
        ".</strong></a>";
      $(this).addClass("active");
      $(this).find(".st-compare-bt-loading").css({ display: "block" });
      var object_e = $(this);
      if ($(this).hasClass("added") || $(this).hasClass("delete")) {
        $.ajax({
          type: "POST",
          headers: { "cache-control": "no-cache" },
          url: productcompare_url,
          async: !0,
          cache: !1,
          data: { ajax: 1, action: "remove", id_product: id_product },
          success: function (result) {
            if ($(".ap-btn-compare .ap-total-compare").length) {
              var old_num_compare = parseInt(
                $(".ap-btn-compare .ap-total-compare").text()
              );
              var new_num_compare = old_num_compare - 1;
              $(".ap-btn-compare .ap-total-compare").text(new_num_compare);
            }
            compared_products.splice(
              $.inArray(parseInt(id_product), compared_products),
              1
            );
            if (object_e.hasClass("delete")) {
              if ($(".leo-productscompare-item").length == 1) {
                window.location.replace(productcompare_url);
              } else {
                $("td.product-" + id_product).fadeOut(function () {
                  $(this).remove();
                });
              }
            } else {
              $(".st-modal-compare .modal-title").html(
                content_product_compare_mess_remove
              );
              $(".st-modal-compare").modal("show");
              $(
                ".st-compare-button[data-id-product=" + id_product + "]"
              ).removeClass("added");
              $(".st-compare-button[data-id-product=" + id_product + "]").attr(
                "title",
                buttoncompare_title_add
              );
              $(
                ".st-compare-button[data-id-product=" +
                  id_product +
                  "] .st-compare-bt-content .ajax_compare_text"
              ).text(buttoncompare_title_add);
              object_e.find(".st-compare-bt-loading").hide();
            }
          },
          error: function (XMLHttpRequest, textStatus, errorThrown) {
            alert(
              "TECHNICAL ERROR: \n\nDetails:\nError thrown: " +
                XMLHttpRequest +
                "\n" +
                "Text status: " +
                textStatus
            );
          },
        });
      } else {
        if (total_product_compare < comparator_max_item) {
          $.ajax({
            type: "POST",
            headers: { "cache-control": "no-cache" },
            url: productcompare_url,
            async: !0,
            cache: !1,
            data: { ajax: 1, action: "add", id_product: id_product },
            success: function (result) {
              $(".st-modal-compare .modal-title").html(
                content_product_compare_mess_add
              );
              $(".st-modal-compare").modal("show");
              if ($(".ap-btn-compare .ap-total-compare").length) {
                var old_num_compare = parseInt(
                  $(".ap-btn-compare .ap-total-compare").text()
                );
                var new_num_compare = old_num_compare + 1;
                $(".ap-btn-compare .ap-total-compare").text(new_num_compare);
              }
              compared_products.push(id_product);
              $(
                ".st-compare-button[data-id-product=" + id_product + "]"
              ).addClass("added");
              $(".st-compare-button[data-id-product=" + id_product + "]").attr(
                "title",
                buttoncompare_title_remove
              );
              $(
                ".st-compare-button[data-id-product=" +
                  id_product +
                  "] .st-compare-bt-content .ajax_compare_text"
              ).text(buttoncompare_title_remove);
              object_e.find(".st-compare-bt-loading").hide();
            },
            error: function (XMLHttpRequest, textStatus, errorThrown) {
              alert(
                "TECHNICAL ERROR: \n\nDetails:\nError thrown: " +
                  XMLHttpRequest +
                  "\n" +
                  "Text status: " +
                  textStatus
              );
            },
          });
        } else {
          $(".st-modal-compare .modal-title").html(
            content_product_compare_mess_max
          );
          $(".st-modal-compare").modal("show");
          object_e.find(".st-compare-bt-loading").hide();
        }
      }
    }
    return !1;
  });
}
function activeEventModalCompare() {
  $(".st-modal-compare").on("hide.bs.modal", function (e) {
    if ($(".st-compare-button.active").length) {
      $(".st-compare-button.active").removeClass("active");
    }
  });
  $(".st-modal-compare").on("hidden.bs.modal", function (e) {
    $("body").css("padding-right", "");
  });
  $(".st-modal-compare").on("shown.bs.modal", function (e) {
    if ($(".quickview.modal").length) {
      $(".quickview.modal").modal("hide");
    }
  });
}
